import React from 'react';

class Home extends React.Component {

  render() {
    return(
      <div style={{padding: 20}}>

        <h1>AirGarage Homework Assignment</h1>

        <input type="text" id="name" name="name"></input>

        <button>Submit Search</button>


        <ul>
          <li>Test location</li>
        </ul>


      </div>



    );
  }
}

export default Home;
